# println!("Problem parsing arguments: {err}");
# process::exit(1);
# });
# println!("Searching for {}", config.query); println!("In file {}", config.file_path); run(config);
} fn run(config: Config) { let contents = fs::read_to_string(config.file_path) .expect("Should have been able to read the file"); println!("With text:\n{contents}");
} // --snip--
# # struct Config {
# query: String,
# file_path: String,
# }
# # impl Config {
# fn build(args: &[String]) -> Result<Config, &'static str> {
# if args.len() < 3 {
