# }
# # let query = args[1].clone();
# let file_path = args[2].clone();
# # Ok(Config { query, file_path })
# }
# } Listing 12-11: Extracting a run function containing the rest of the program logic The run function now contains all the remaining logic from main, starting from reading the file. The run function takes the Config instance as an argument. Returning Errors from the run Function With the remaining program logic separated into the run function, we can improve the error handling, as we did with Config::build in Listing 12-9. Instead of allowing the program to panic by calling expect, the run function will return a Result<T, E> when something goes wrong. This will let us further consolidate the logic around handling errors into main in a user-friendly way. Listing 12-12 shows the changes we need to make to the signature and body of run. Filename: src/main.rs # use std::env;
# use std::fs;
# use std::process;
use std::error::Error; // --snip-- # # fn main() {
# let args: Vec<String> = env::args().collect();
# # let config = Config::build(&args).unwrap_or_else(|err| {
# println!("Problem parsing arguments: {err}");
# process::exit(1);
# });
