} fn another_function(x: i32) { println!("The value of x is: {x}");
} Try running this program; you should get the following output: $ cargo run Compiling functions v0.1.0 (file:///projects/functions) Finished dev [unoptimized + debuginfo] target(s) in 1.21s Running `target/debug/functions`
The value of x is: 5 The declaration of another_function has one parameter named x. The type of x is specified as i32. When we pass 5 in to another_function, the println! macro puts 5 where the pair of curly brackets containing x was in the format string. In function signatures, you must declare the type of each parameter. This is a deliberate decision in Rust’s design: requiring type annotations in function definitions means the compiler almost never needs you to use them elsewhere in the code to figure out what type you mean. The compiler is also able to give more helpful error messages if it knows what types the function expects. When defining multiple parameters, separate the parameter declarations with commas, like this: Filename: src/main.rs fn main() { print_labeled_measurement(5, 'h');
